        internal void BuildString(StringBuilder builder)
        {
            if (_buffer == null)
            {
                throw new ArgumentNullException("_buffer");
            }

            int originalLimit = this.Limit;
            this.Limit = _offset + _actingBlockLength;
            builder.Append("[AccountAllocationsResponse](sbeTemplateId=");
            builder.Append(AccountAllocationsResponse.TemplateId);
            builder.Append("|sbeSchemaId=");
            builder.Append(AccountAllocationsResponse.SchemaId);
            builder.Append("|sbeSchemaVersion=");
            if (_parentMessage._actingVersion != AccountAllocationsResponse.SchemaVersion)
            {
                builder.Append(_parentMessage._actingVersion);
                builder.Append('/');
            }
            builder.Append(AccountAllocationsResponse.SchemaVersion);
            builder.Append("|sbeBlockLength=");
            if (_actingBlockLength != AccountAllocationsResponse.BlockLength)
            {
                builder.Append(_actingBlockLength);
                builder.Append('/');
            }
            builder.Append(AccountAllocationsResponse.BlockLength);
            builder.Append("):");

            builder.Append("Allocations=[");
            var allocations = this.Allocations;
            if (allocations.Count > 0)
            {
                var first = true;
                while (allocations.HasNext)
                {
                    if (!first)
                    {
                        builder.Append(',');
                    }
                    first = false;
                    allocations.Next().BuildString(builder);
                }
            }
            builder.Append("]");

            this.Limit = originalLimit;

        }
